import LeftLink from "./LeftLink";
import "./style.css";
import {left} from "../../../data/home";

export default function LeftHome({ user }) {
  return (
    <div className="left_home">
      <div className="left_link">
        <img src={user?.picture} alt="" />
        <br />
        <span>
          {user?.first_name} {user.last_name}
        </span>
      </div>
      <LeftLink />
    </div>
  );
}
